import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './StudentDashboard.css';
import CertificateOfRegistration from './CertificateOfRegistration';

const StudentDashboard = ({ studentData }) => {
  const navigate = useNavigate();
  const [activeSection, setActiveSection] = useState('dashboard');
  const [sidebarOpen, setSidebarOpen] = useState(true);
  const [isMobile, setIsMobile] = useState(window.innerWidth < 768);

  useEffect(() => {
    const handleResize = () => {
      const mobile = window.innerWidth < 768;
      setIsMobile(mobile);
      if (mobile) {
        setSidebarOpen(false);
      }
    };

    window.addEventListener('resize', handleResize);
    return () => window.removeEventListener('resize', handleResize);
  }, []);

  const handleLogout = () => {
    navigate('/login');
  };

  const toggleSidebar = () => {
    setSidebarOpen(!sidebarOpen);
  };

  const handleCORNavigation = () => {
    setActiveSection('cor');
  };

  const handleCloseCOR = () => {
    setActiveSection('dashboard');
  };

  if (!studentData) {
    return (
      <div className="admin-dashboard-loading">
        <div className="loading-spinner"></div>
        <p>Loading student data...</p>
      </div>
    );
  }

  const navItems = [
    { id: 'dashboard', label: 'Dashboard', lineIcon: 'â–£' },
    { id: 'academics', label: 'Academic Records', lineIcon: 'â–¤' },
    { id: 'documents', label: 'Online Documents', lineIcon: 'â—‹' },
    { id: 'cor', label: 'COR Generator', lineIcon: 'â–¡' },
    { id: 'scheduler', label: 'Request Scheduler', lineIcon: 'â–§' },
    { id: 'applications', label: 'Applications', lineIcon: 'ðŸ“‹' },
    { id: 'profile', label: 'My Profile', lineIcon: 'ðŸ‘¤' },
    { id: 'settings', label: 'Account Settings', lineIcon: 'â—·' },
    { id: 'resources', label: 'Campus Resources', lineIcon: 'ðŸ›ï¸' },
